  `created_at` datetime DEFAULT NULL,
  `version_id` int(11) unsigned NOT NULL,
  `result` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `svn_url` varchar(255) DEFAULT NULL,
  `svn_revision` varchar(45) DEFAULT NULL,
  `certification` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FKADDD07C5485DF151` (`product_id`),
  KEY `FK_builds_to_version` (`version_id`),
  CONSTRAINT `FKADDD07C5485DF151` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`),
  CONSTRAINT `FK_builds_to_products` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`),
  CONSTRAINT `FK_builds_to_version` FOREIGN KEY (`version_id`) REFERENCES `version` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1023 DEFAULT CHARSET=utf8;

