  KEY `FK_issue_to_version` (`version_id`),
  CONSTRAINT `FK_issue_to_product` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`),
  CONSTRAINT `FK_issue_to_version` FOREIGN KEY (`version_id`) REFERENCES `version` (`id`)
